from collections import deque

def __starting_point():
    num = int(input().strip())
    deq = deque()

    for _ in range(num):
        args = input().strip().split()

        if args[0] == 'append':
            deq.append(args[1])
        elif args[0] == 'appendleft':
            deq.appendleft(args[1])
        elif args[0] == 'pop':
            deq.pop()
        elif args[0] == 'popleft':
            deq.popleft()

    out = []
    for el in deq:
        out.append(el)

